"""For, if and Function Project

"""

incomes = [2000,3000,5000,10]

def incomes_up(x):
  print(x*10/100 + x)

def incomes_down(x):
  print(x*20/100 + x)

def incomes_eq(x):
  print(x)

for i in incomes:
  if i > 3000:
    incomes_up(i)
  elif i == 3000:
    incomes_eq(i)
  else:
    incomes_down(i)

"""Break & Continue"""

incomes = [100,200,3000,4000,5000,10000,20]

dir(incomes)

incomes.sort()
incomes

for i in incomes:
  if i == 4000:
    print("Stop!")
    break
  print(i)

for i in incomes:
  if i == 4000:
    continue
  print(i)

